gWn(){return"__\u0421\u0443\u0442\u044c \u0438 \u0437\u0430\u0434\u0430\u0447\u0430 \u0438\u0433\u0440\u044b__ - \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u0434\u0440\u0443\u0437\u044c\u044f\u043c\u0438 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u043b\u044c\u043d\u0443\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u044e \u043d\u0430 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u0443\u044e \u0442\u0435\u043c\u0443. \u0418, \u043a\u043e\u043d\u0435\u0447\u043d\u043e, \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c \u0443\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u0435 \u0438 \u043e\u0442 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430 \u0438 \u043e\u0442 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0430 :-) \n\n\n__\u041f\u0440\u0430\u0432\u0438\u043b\u0430 \u0438\u0433\u0440\u044b:__\n\n - \u0418\u0433\u0440\u043e\u043a\u0438 \u0445\u043e\u0434\u044f\u0442 \u043f\u043e \u043e\u0447\u0435\u0440\u0435\u0434\u0438. \u041a\u0430\u0436\u0434\u044b\u0439 \u0438\u0433\u0440\u043e\u043a \u0432 \u0441\u0432\u043e\u0439 \u0445\u043e\u0434 \u0442\u044f\u043d\u0435\u0442 \u043a\u0430\u0440\u0442\u0443 \u0438\u0437 \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0442\u0440\u0451\u0445 \u043a\u043e\u043b\u043e\u0434 \u043d\u0430 \u0432\u044b\u0431\u043e\u0440 \u0438 \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0441\u0432\u043e\u044e \u0447\u0430\u0441\u0442\u044c \u0438\u0441\u0442\u043e\u0440\u0438\u0438, \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0443\u044f\u0441\u044c \u0442\u043e\u0439 \u043a\u0430\u0440\u0442\u043e\u0439, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0435\u043c\u0443 \u0432\u044b\u043f\u0430\u043b\u0430. \n - \u0412\u043e \u0432\u0440\u0435\u043c\u044f \u0445\u043e\u0434\u0430 \u0438\u0433\u0440\u043e\u043a\u0430 \u043d\u0438\u043a\u0442\u043e \u043d\u0435 \u0438\u043c\u0435\u0435\u0442 \u043f\u0440\u0430\u0432\u0430 \u0435\u0433\u043e \u043f\u043e\u043f\u0440\u0430\u0432\u043b\u044f\u0442\u044c \u0438\u043b\u0438 \u043f\u0435\u0440\u0435\u0431\u0438\u0432\u0430\u0442\u044c, \u043e\u043d \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0441\u0432\u043e\u0431\u043e\u0434\u0435\u043d \u0432 \u0442\u0440\u0430\u043a\u0442\u043e\u0432\u043a\u0435 \u0441\u043c\u044b\u0441\u043b\u0430 \u043a\u0430\u0440\u0442\u044b \u0438 \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u0441\u0432\u043e\u0435\u0439 \u0447\u0430\u0441\u0442\u0438 \u0438\u0441\u0442\u043e\u0440\u0438\u0438, \u0445\u043e\u0442\u044f \u0438 \u0434\u043e\u043b\u0436\u0435\u043d \u043e\u043f\u0438\u0440\u0430\u0442\u044c\u0441\u044f \u043d\u0430 \u0437\u0434\u0440\u0430\u0432\u044b\u0439 \u0441\u043c\u044b\u0441\u043b, \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u0439 \u0440\u0430\u043d\u0435\u0435 \u0441\u044e\u0436\u0435\u0442 \u0438 \u043e\u0431\u0449\u0438\u0435 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0451\u043d\u043d\u043e\u0441\u0442\u0438.\n - \u041f\u0435\u0440\u0435\u0434 \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u0438\u0433\u0440\u044b \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0435\u0442\u0441\u044f \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0440\u0435\u0448\u0438\u0442\u044c, \u043a \u043a\u0430\u043a\u043e\u043c\u0443 \u0436\u0430\u043d\u0440\u0443, \u0441\u0442\u0438\u043b\u044e \u0438 \u0432\u0441\u0435\u043b\u0435\u043d\u043d\u043e\u0439 \u0431\u0443\u0434\u0435\u0442 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043f\u043e\u0432\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435.\n\n__\u0412\u0438\u0434\u044b \u043a\u0430\u0440\u0442.__ \u041a\u0430\u0440\u0442\u044b \u0432 \u0438\u0433\u0440\u0435 \u0435\u0441\u0442\u044c \u0442\u0440\u0451\u0445 \u0442\u0438\u043f\u043e\u0432:\n - \u041c\u0435\u0441\u0442\u043e - \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442, \u0447\u0442\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u0441\u044e\u0436\u0435\u0442\u0430 \u0434\u043e\u043b\u0436\u043d\u043e \u0431\u044b\u0442\u044c \u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043e \u0432 \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u043e\u0435 \u043d\u0430 \u043a\u0430\u0440\u0442\u0435 \u043c\u0435\u0441\u0442\u043e (\u0432 \u043f\u0440\u044f\u043c\u043e\u043c \u0438\u043b\u0438 \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u043d\u043e\u043c \u0441\u043c\u044b\u0441\u043b\u0435)\n - \u041f\u0435\u0440\u0441\u043e\u043d\u0430\u0436 - \u0432\u044b\u0442\u044f\u043d\u0443\u0432\u0448\u0438\u0439 \u044d\u0442\u0443 \u043a\u0430\u0440\u0442\u0443 \u0438\u0433\u0440\u043e\u043a \u0434\u043e\u043b\u0436\u0435\u043d \u0432\u0432\u0435\u0441\u0442\u0438 \u0432 \u043f\u043e\u0432\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430 (\u0432 \u043f\u0440\u044f\u043c\u043e\u043c \u0438\u043b\u0438 \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u043d\u043e\u043c \u0441\u043c\u044b\u0441\u043b\u0435), \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u043e\u0433\u043e \u043d\u0430 \u043a\u0430\u0440\u0442\u0435. \n - \u041e\u0431\u0449\u0430\u044f - \u044d\u0442\u0438 \u043a\u0430\u0440\u0442\u044b \u0437\u0430\u0434\u0430\u044e\u0442 \u0442\u0435\u043c\u0443 \u0434\u043b\u044f \u0432\u0441\u0435\u0445 \u043e\u0441\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u043e\u0431\u044b\u0442\u0438\u0439/\u044f\u0432\u043b\u0435\u043d\u0438\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0434\u043e\u043b\u0436\u043d\u044b \u043f\u0440\u043e\u0438\u0437\u043e\u0439\u0442\u0438 \u0432 \u0438\u0433\u0440\u043e\u0432\u043e\u043c \u043c\u0438\u0440\u0435 \u0432 \u0445\u043e\u0434 \u0432\u044b\u0442\u044f\u043d\u0443\u0432\u0448\u0435\u0433\u043e \u0438\u0445 \u0438\u0433\u0440\u043e\u043a\u0430. \n\n\u041d\u041e \u043d\u0435 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0435\u0441\u044c \u043a \u044d\u0442\u043e\u043c\u0443 \u0447\u0435\u0440\u0435\u0441\u0447\u0443\u0440 \u0441\u0435\u0440\u044c\u0451\u0437\u043d\u043e! \u041f\u043e\u043c\u043d\u0438\u0442\u0435 - \u044d\u0442\u043e \u0432\u0441\u0435\u0433\u043e \u043b\u0438\u0448\u044c \u0438\u0433\u0440\u0430 ;-)"},
